package leetcode.algorithms;

/**
 * Description: 1163. Last Substring in Lexicographical Order
 *
 * @author Baltan
 * @date 2019-10-22 09:19
 */
public class LastSubstring {
    public static void main(String[] args) {
        System.out.println(lastSubstring("abab"));
        System.out.println(lastSubstring("leetcode"));
        System.out.println(lastSubstring(
                "xbylisvborylklftlkcioajuxwdhahdgezvyjbgaznzayfwsaumeccpfwamfzmkinezzwobllyxktqeibfoupcpptncggrdqbkji"
        ));
        System.out.println(
                "");
    }

    public static String lastSubstring(String s) {
        /**
         * 
         */
        int maxHead = s.charAt(0);
        /**
         * 
         */
        int maxHeadIndex = 0;
        int length = s.length();

        for (int i = 1; i < length; i++) {
            char c = s.charAt(i);
            /**
             * 
             * 
             * 
             */
            if (c > maxHead) {
                maxHead = c;
                maxHeadIndex = i;
            } else if (c == maxHead) {
                int currentMaxHeadIndex = isGreater(s, i, maxHeadIndex);
                /**
                 * 
                 * 
                 */
                if (currentMaxHeadIndex == -1) {
                    return s.substring(maxHeadIndex);
                } else if (currentMaxHeadIndex != maxHeadIndex) {
                    maxHeadIndex = i;
                    maxHead = s.charAt(i);
                }
            }
        }
        return s.substring(maxHeadIndex);
    }

    /**
     * ij-1
     * 
     *
     * @param s
     * @param i
     * @param j
     * @return
     */
    public static int isGreater(String s, int i, int j) {
        int length = s.length();
        int offset = 1;

        while (i + offset < length && j + offset < length) {
            if (s.charAt(j + offset) > s.charAt(i + offset)) {
                return j;
            } else if (s.charAt(j + offset) < s.charAt(i + offset)) {
                return i;
            }
            offset++;
        }
        return -1;
    }
}
